    db.collection("Available").get().then((querySnapshot) => {
        querySnapshot.forEach((doc) => {
            // doc.data() is never undefined for query doc snapshots
            // console.log(doc.data().mail);
            // console.log(doc.data().name);
           devices[i]=doc.data().name;
           i++;
        });
    });
console.log(devices)
